import React from 'react'
import Navbars from "./navbar"
import NavbarOne from "./navbar1"//navabr after login//
import './dashboard.css'
import PlayerDetails from './playerdetails';

class DashBoard extends React.Component{
    constructor(props){
        super(props);
    }
     getComponent=()=>{
         if(localStorage.getItem("isLoggedIn")== 'true'){
            return(
                <div>
                <NavbarOne />
                <PlayerDetails/>
                </div>
            )
         }
         else{
             return(
                 <div>
                 <Navbars/>
                 </div>
             )
         }
     }

    render(){
        console.log(localStorage.getItem('isLoggedIn'))
        return(
            <div>
                  <div id="carouselExampleControls" class="carousel slide" data-ride="carousel">
  <div class="carousel-inner">
    <div class="carousel-item active">
      <img class="d-block w-100" src="assets/images/bg16.jpeg" alt="First slide"/>
    </div>
    <div class="carousel-item">
      <img class="d-block w-100" src="assets/images/bg2.jpg" alt="Second slide"/>
    </div>
    <div class="carousel-item">
      <img class="d-block w-100" src="assets/images/bg3.jpeg" alt="Third slide"/>
    </div>
  </div>
  <a class="carousel-control-prev" href="#carouselExampleControls" role="button" data-slide="prev">
    <span class="carousel-control-prev-icon" aria-hidden="true"></span>
    <span class="sr-only">Previous</span>
  </a>
  <a class="carousel-control-next" href="#carouselExampleControls" role="button" data-slide="next">
    <span class="carousel-control-next-icon" aria-hidden="true"></span>
    <span class="sr-only">Next</span>
  </a>
</div>
             {this.getComponent()}
            </div>
        )
    }



}

export default DashBoard;
